import { Component, OnInit } from '@angular/core';
import { SideBarJs } from 'src/assets/js/script.js'; // Import fungsi SidebarJs dari file script.js
import { Route, Router } from '@angular/router';
import { HttpClient } from '@angular/common/http';
@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css']
})
export class DashboardComponent implements OnInit {
  constructor(private router:Router, private http:HttpClient){}
  name:string = ''
  email:string =''
  id:string=''
  ngOnInit(): void {
    SideBarJs();
    this.parseLocalStorageData()
    let refreshDone: any = localStorage.getItem('refreshDone');
    if (refreshDone === 'true') {
      location.reload();
      localStorage.setItem('refreshDone', 'false');
    } else {
      localStorage.setItem('refreshDone', 'true');
    }
  }
  parseLocalStorageData() {
    const dataFromLocalStorage = localStorage.getItem("data");
    if (dataFromLocalStorage) {
      try {
        const parsedData = JSON.parse(dataFromLocalStorage);
        this.id = parsedData.id.toString(); // Menyimpan id sebagai string
        this.name = parsedData.name || ''; // Menyimpan name, jika ada
        this.email = parsedData.email || ''; // Menyimpan email, jika ada
            this.http.get<any>("http://128.199.177.206:5173/api/prompt/" + this.id).subscribe(
      res => {
        // console.log(res);
      },
      error => {
        console.error("Terjadi kesalahan:", error);
        // Handle error here
      }
    );
      } catch (error) {
        console.error("Terjadi kesalahan dalam parsing JSON:", error);
      }
    } else {
      console.error("Data dari localStorage tidak tersedia atau null.");
      this.router.navigate(['/']);
    }
  }
}


  <div class="sidebar">
    <div class="logo-details">
      <!-- <i class='bx bxl-c-plus-plus icon'></i> -->
      <img src="../assets/icon/openai.svg" alt="" srcset="" style="width:2.3rem;" class="icon">
        <div class="logo_name">Gwen.AI</div>
        <i class='bx bx-menu' id="btn" ></i>
    </div>
    <ul class="nav-list">
      <li>
          <i class='bx bx-search' ></i>
         <input type="text" placeholder="Search...">
         <span class="tooltip">Search</span>
      </li>
      <li>
        <a href="/dashboard/prompt">
          <i class='bx bx-grid-alt'></i>
          <span class="links_name">Dashboard</span>
        </a>
         <span class="tooltip">Dashboard</span>
      </li>
      <li>
        <a href="/dashboard/list">
            <i class='bx bx-hdd' ></i>
          <span class="links_name">Saved Prompt</span>
        </a>
         <span class="tooltip">Saved Prompt</span>
      </li>
     <li class="profile">
         <div class="profile-details">
           <img src="../assets/icon/AIHERO.svg" alt="profileImg">
           <div class="name_job">
             <div class="name">GewnAi</div>
             <div class="job">{{email}}</div>
           </div>
         </div>
         <i class='bx bx-log-out' id="log_out" ></i>
     </li>
    </ul>
  </div>
  <section class="home-section">
     <router-outlet></router-outlet>
  </section>

  <script src="script.js"></script>
